h their own memory space, while threads share the same memory space",tag:["Process","Thread","Operating System"]},{questionText:"In a relational database, what is the purpose of a foreign key constraint?",options:["To ensure that the data in a table is unique","To define a relationship between two tables by referencing a primary key in another table","To enforce data integrity by preventing the insertion of duplicate values","To optimize query performance by creating indexes on frequently accessed columns"],answer:"To define a relationship between two tables by referencing a primary key in another table",tag:["Relational Database","Foreign Key","Data Integrity"]},{questionText:"What is the difference between a static variable and a dynamic variable in programming?",options:["Static variables are declared within a function, while dynamic variables are declared outside a function","Static variables have a fixed memory address, while dynamic variables have a memory address that can change","Static variables are allocated on the stack, while dynamic variables are allocated on the heap","Static variables retain their value between function calls, while dynamic variables do not"],answer:"Static variables retain their value between function calls, while dynamic variables do not",tag:["Static Variable","Dynamic Variable","Variable Scope"]},{questionText:"What is the purpose of a mutex in multithreaded programming?",options:["To ensure that only one thread can access a shared resource at a time","To allow multiple threads to access a shared resource concurrently","To synchronize the execution of multiple threads by allowing them to wait for each other","To communicate data between different threads by passing messages"],answer:"To ensure that only one thread can access a shared resource at a time",tag:["Mutex","Multithreading","Synchronization"]},{questionText:"What is the difference between a TCP connection and a UDP connection?",options:["TCP is a connection-oriented proto
